-- ----------------------------
-- Table structure for `cms_learn_records`
-- ----------------------------
DROP TABLE IF EXISTS `cms_learn_records`;
CREATE TABLE `cms_learn_records` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '主键',
  `user_id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '用户ID',
  `article_id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '文章ID',
  `difficulty_degree` char(1) COLLATE utf8_bin DEFAULT '0' COMMENT '困难度，默认为0',
  `help_degree` char(1) COLLATE utf8_bin DEFAULT '0' COMMENT '帮助度，默认为0',
  `create_by` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '创建时间',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '更新者',
  `update_date` datetime NOT NULL COMMENT '更新时间',
  `learn_minutes` int(11) DEFAULT '0' COMMENT '学习时长，默认为0',
  `remarks` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '备注',
  `del_flag` char(1) COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '删除标记，默认值为0',
  PRIMARY KEY (`id`),
  KEY `cms_records_index` (`user_id`,`article_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='学习记录';

